import React, {Component} from 'react';


class Create extends Component {
    render() {   
      return(
      <addplayer>       
         <form id="addTodoFrm" onSubmit={function (event) {
           event.preventDefault();
           this.props.addTodo(event.target.importance.value, event.target.title.value, event.target.task.value, event.target.deadline.value);
       }}>
         <h2>add todo</h2>
         <input type='text' name='importance' placeholder='Importance' required></input><br/>
         <input type='text' name='title' placeholder='Title' required></input><br/>
         <input type='text' name='task' placeholder='Task'></input><br/>
         <input type='text' name='deadline' placeholder='Deadline' required></input><br/>
         <input type="submit">add</input>
         </form>
      </addplayer>
      );
    }
  }

  export default Create;
